text:
Estão abertas as inscrições para as Transferências e Retornos 2022/2:

👉Transferências de estudantes de outras instituições;
👉Retorno de graduados (portadores de diploma);
👉Retorno de alunos que abandonaram cursos em meus campi;
👉Transferências internas (turno/curso/campus). https://t.co/D2LHvpFENc

Para concorrer, o candidato precisa:
✔️ Ter concluído o Ensino Médio;
✔️ Ter feito o ENEM (válido para as edições de 2009 a 2021);
✔️ Ter tirado 300 pontos ou mais na prova de redação do ENEM e não ter zerado as demais.

🔎 A seleção de candidatos observará os seguintes critérios, prioritariamente:

1⃣ Ordem de inscrição no processo seletivo, considerando a data, hora, minuto e segundo referente à última inscrição realizada;

2⃣ Idade, com preferência pelo candidato de maior idade.

🔁 Há vagas para:
• Transferências de outras instituições de ensino para UFFS;
• Transferências de campus, no âmbito da UFFS;
• Retorno de alunos que tenham abandonado curso de medicina na UFFS.

+ informações em https://t.co/dHcBkLKUsG

# Universidadepública #UFFS #medicina https://t.co/Xdxfg4z3va

Agora é aguardar a convocação da 2ª chamada (datas previstas):
➡️ Campus Passo Fundo, dia 14/03; 
➡️ Campi Cerro Largo, Chapecó, Erechim, Laranjeiras do Sul e Realeza, dia 15/03.

Há vagas para:
➡ trocas de turno, curso e campus;
➡ estudantes de outras universidades;
➡ retorno de graduados que buscam uma nova formação;
➡ estudantes que abandonaram algum dos meus cursos e querem retornar.

➕ informações em https://t.co/dHcBkLKUsG https://t.co/7qMUzqvujf

💚 Passei na UFFS e agora? Primeiramente, parabéns pela aprovação! 

Agora:
1. Verifique a documentação necessária no edital; 
2. A matrícula é, exclusivamente, on-line; 
3. As informações de acesso, login e senha, foram encaminhadas para seu e-mail. https://t.co/uB2LCHCMiD

Linhas de pesquisa: 
1. Processamento de alimentos e aproveitamento de subprodutos;
2. Microbiologia e bioprocessos;
3. Análise de alimentos e química de processos verdes;
4. Processos e modelagem matemática aplicada a alimentos.

Por que um mestrado em Geografia?
Siga a thread:
1.Demanda por profissionais qualificados gerada por instituições de ensino, empresas, movimentos sociais, organizações não governamentais (ONGs) e órgãos públicos da região;

